<html>
<style>
    @page {
        size: a6 portrait;

        @frame background_image { /* Another static Frame */
            -pdf-frame-content: background_image;
            left: 0pt;width: auto;top: 0pt;height: 692pt;
            -pdf-frame-border: 1;  
        }

        @frame name { /* Another static Frame */
            -pdf-frame-content: name;
            left: 33pt; top: 215pt; width: 130pt;
        }
        @frame phone_number { /* Another static Frame */
            -pdf-frame-content: phone_number;
            right: 35pt; top: 215; width: 80pt;
        }
        @frame paroisse { /* Another static Frame */
            -pdf-frame-content: paroisse;
            right: 35pt; top: 249pt; width: 86pt;
        }
        @frame diocese { /* Another static Frame */
            -pdf-frame-content: diocese;
            left: 33pt; top: 249pt; width: 85pt;
        }
        @frame sexe { /* Another static Frame */
            -pdf-frame-content: sexe;
            left: 33pt; top: 279pt; width: 20pt;
        }
        @frame age { /* Another static Frame */
            -pdf-frame-content: age;
            left: 33pt; top: 309pt; width: 50pt;
        }
        @frame cni { /* Another static Frame */
            -pdf-frame-content: cni;
            right: 35pt; top: 309pt; width: 70pt;
        }
        @frame site { /* Another static Frame */
            -pdf-frame-content: site;
            right: 35pt; top: 278pt; width: 86pt;
        }
        @frame qrcode { /* Another static Frame */
            -pdf-frame-content: qrcode;
            left: 125pt; top: 246pt; width: 47pt;
        }
        @frame code { /* Another static Frame */
            -pdf-frame-content: code;
            left: 110pt; top: 297pt; width: 85pt;
        }
        @frame person_contacter_phone { /* Another static Frame */
            -pdf-frame-content: person_contacter_phone;
            left: 100pt; top: 338pt; width: 95pt;
        }
        @frame person_contacter_name { /* Another static Frame */
            -pdf-frame-content: person_contacter_name;
            left: 90pt; top: 328pt; width: 120pt;
        }
        @frame polo { /* Another static Frame */
            -pdf-frame-content: polo;
            left: 42pt; top: 351pt; width: 24pt;
        }
        @frame photo { /* Another static Frame */
            -pdf-frame-content: photo;
            left: 98pt; top: 103pt; width: 101pt;
        }
    }
    #name {
        color: #000;font-size: 1.8rem;line-height: 12px;font-weight: bold;background-color: #fff;
    }
    #phone_number {
        color: #000;font-size: 1.8rem;background-color: #fff;line-height: 12px;font-weight: bold;text-align: right;
    }
    #paroisse {
        color: #000;font-size: 1rem;background-color: #fff;line-height: 12px;font-weight: bold;text-align: right;
    }
    #qrcode {
        background-color: #fff;
    }
    #qrcode img {
        width: 60px;
    }
    #diocese {
        color: #000;font-size: 1.8rem;line-height: 0px;background-color: #fff;font-weight: bold;
    }
    #sexe {
        color: #000;font-size: 1.8rem;line-height: 0px;background-color: #fff;font-weight: bold;
    }
    #age {
        color: #000;font-size: 1.8rem;line-height: 0px;background-color: #fff;font-weight: bold;
    }
    #cni {
        color: #000;font-size: 1.5rem;line-height: 0px;background-color: #fff;font-weight: bold;
        text-align: right;
    }
    #polo {
        color: #000;font-size: 1.5rem;line-height: 0px;background-color: #fff;font-weight: bold;
        text-align: center; 
    }
    #person_contacter_phone {
        color: #000;font-size: 1.8rem;background-color: #fff;text-align: center;line-height: 12px;font-weight: bold;
    }
    #person_contacter_name {
        color: #000;font-size: 1rem;background-color: #fff;text-align: center;line-height: 12px;font-weight: bold;
    }
    #code {
        font-size: 1rem;font-weight: bold;line-height: 1rem;background-color: #fff;
    }
    #site {
        font-size: 1rem;font-weight: bold;line-height: 0px;background-color: #fff; text-align: right;
    }
</style>

<body>

    <div id="code">
        {{part.code}}
    </div>

    <!-- Content for Static Frame 'qrcode' -->
    <div id="qrcode">
        <img src="data:image/png;base64,{{ qrcode | safe }}">
    </div>

    <div id="name">
        {{name}}
    </div>

    <div id="phone_number">
        {{part.phone_number}}
    </div>

    <div id="paroisse">
        {{part.paroisse}}
    </div>

    <div id="diocese">
        {{diocese}}
    </div>

    <div id="person_contacter_name">
        {{person_contacter_name}}
    </div>

    <div id="person_contacter_phone">
        {{part.person_contacter_phone}}
    </div>

    <div id="sexe">
        {{part.sexe}}
    </div>

    <div id="age">
        {{part.age}} ans
    </div>

    <div id="polo">
        {{part.polo}}
    </div>

    <div id="cni">
        {{part.cni}}
    </div>

    <div id="site">
        {{part.dortoir.site.designation}} <br>
        {{part.dortoir.code}}
    </div>

    {% if part.photo %}
    <div id="photo">
        <img src="{{ part.photo | safe }}">
    </div>
    {% endif %}
